import React from 'react';
import { useLocation } from 'react-router-dom';
import { sampleData } from './sampleData';
import "./pages/Contacts/produucts.css"
import one from './pages/Contacts/str2.module.css'

const SearchResults = () => {

  const query = new URLSearchParams(useLocation().search).get('query');

  const filteredData = sampleData.filter((item) =>
    item.title.toLowerCase().includes(query.toLowerCase())
  );

  return (

    <>
      
      <div>
      
      <div className={one.glavvvv}>
        <div className={one.glavvv}>
        
        <div className={one.glav}>
  
        <div className={one.glav1}>
        <div className={one.onas}>Результаты поиска для: "{query}"</div>
        
        <div className={one.onastext}>
        {filteredData.length ? (
          filteredData.map((item) => (
            <div key={item.id}>
              <h3>{item.title}</h3>
              <p>{item.content}</p>
            </div>
          ))
        ) : (
          <p>Ничего не найдено.</p>
        )}
  Все нюансы по транспортировке груза, в том числе сроки, порты погрузки и выгрузки, тип и общий объем груза, ставка провозной платы за единицу груза, указываются в договоре фрахтования (чартере).
        </div>
  
        <div className={one.onas2}>Подписка на нашу рассылку</div>
        <div className={one.onas3}>
          <div className={one.onas3text}>Вы всегда можете быть в курсе новых поступлений флота, информации о «горячих» выгодных предложениях на продажу и получать уведомления об этом на электронную почту.</div>
          <div className={one.onas3form}>
          <input className={one.inp} pattern="^[A-Za-z0-9](([_\.\-]?[a-zA-Z0-9]+)*)@([A-Za-z0-9]+)(([\.\-]?[a-zA-Z0-9]+)*)\.([A-Za-z])+$" type="email" name="email" placeholder="Введите ваш E-mail" maxLength={25} required
            />
          <div className={one.onas3knop}>ПОДПИСАТЬСЯ</div>
          </div>
          </div>
        </div>
        <div className={one.glav2}></div>
  
        <div className={one.glav3}>
        <div className={one.glav3a}></div>
        </div>
  
        </div>
        
      </div>
  
  
      </div>
  
    </div>

   
  </>




   
  );
};

export default SearchResults;
